import React from 'react';
import { Link } from 'react-router-dom';

const Header: React.FC = () => {
    return (
        <header className="bg-green-500 p-4">
            <h1 className="text-white text-2xl">Green IT & Solar BIPV Management</h1>
            <nav>
                <ul className="flex space-x-4">
                    <li>
                        <Link to="/" className="text-white hover:underline">Home</Link>
                    </li>
                    <li>
                        <Link to="/bipv-tool" className="text-white hover:underline">BIPV Tool</Link>
                    </li>
                    <li>
                        <Link to="/dashboard" className="text-white hover:underline">Dashboard</Link>
                    </li>
                    <li>
                        <Link to="/resources" className="text-white hover:underline">Resources</Link>
                    </li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
